import React from "react";

interface FoodCardProps {
  image: string;
  title: string;
  price: string;
  rating: number;
  quantity: string;
  description: string;
}

export const FoodCard: React.FC<FoodCardProps> = ({
  image,
  title,
  price,
  rating,
  quantity,
  description,
}) => {
  const renderStars = (rating: number) => {
    const stars = [];
    for (let i = 0; i < 5; i++) {
      const starImage =
        i < Math.floor(rating)
          ? "https://api.builder.io/api/v1/image/assets/TEMP/b8a2cafbefb30d676a3a64694d2ad2a66ddbaafd?placeholderIfAbsent=true&apiKey=b59f74ae8c9444f28ee33eff06842d33"
          : i === Math.floor(rating) && rating % 1 !== 0
            ? "https://api.builder.io/api/v1/image/assets/TEMP/28d816dd0284c5d984c359268f23d1ea6cbde4dc?placeholderIfAbsent=true&apiKey=b59f74ae8c9444f28ee33eff06842d33"
            : "https://api.builder.io/api/v1/image/assets/TEMP/e03d566e8e9efb90a605329987f67fffd24c38ba?placeholderIfAbsent=true&apiKey=b59f74ae8c9444f28ee33eff06842d33";

      stars.push(
        <img
          key={i}
          src={starImage}
          className="object-contain shrink-0 w-3.5 rounded-2xl aspect-[1.08]"
          alt="star"
        />,
      );
    }
    return stars;
  };

  return (
    <article className="grow pb-5 w-full rounded-2xl bg-zinc-300">
      <img
        src={image}
        className="object-contain w-full rounded-2xl aspect-[1.32]"
        alt={title}
      />
      <div className="flex flex-col px-2.5 mt-2.5 w-full">
        <div className="flex gap-5 justify-between">
          <div className="flex flex-col text-xl font-bold text-black">
            <h3>{title}</h3>
            <div className="self-start mt-1.5">{price}</div>
          </div>
          <div className="flex flex-col self-start mt-1.5">
            <div className="flex gap-px self-start">{renderStars(rating)}</div>
            <div className="self-end mt-9 text-xl font-bold text-black">
              {quantity}
            </div>
          </div>
        </div>
        <p className="self-start mt-5 ml-2.5 text-lg text-black">
          {description}
        </p>
      </div>
    </article>
  );
};
